"Change Set:		7921Collections-nice.162Collections-nice.162:Fix for http://bugs.squeak.org/view.php?id=7258Dictionary asSet does not behave like a Set"!!Dictionary methodsFor: 'converting' stamp: 'nice 10/6/2009 14:15'!asSet	"Though implemented as a subclass of Set for conveniency, a Dictionary is not a Set.	It has to be converted, like super super implementation."		^Set withAll: self! !